document.addEventListener("DOMContentLoaded", function () {
    let accordions = document.querySelectorAll(".acc");
    accordions.forEach(function (acc) {
        acc.addEventListener('click', function () {
            let wasOpen = false;
            let content = this.nextElementSibling;
            if (content.style.maxHeight) {
                wasOpen = true;
            }
            accordions.forEach(function (innerAcc) {
                let innerContent = innerAcc.nextElementSibling;
                innerContent.style.maxHeight = null;
                innerContent.closest('.acc_container').classList.remove('show');
            });
            if (!wasOpen) {
                content.style.maxHeight = content.scrollHeight + "px";
                content.closest('.acc_container').classList.add('show');
            }
        });
    });
});

const rawData = [
    1672531199,
    1672617599,
    1672703999,
    1675027199,
    1675113599,
    1675199999,
    1675286399,
    1677705599,
    1677791999,
    1677878399,
    1677964799,
    1680183999,
    1680270399,
];

function processData(rawData) {
    const groupedByDay = {};
    const groupedByMonth = {};

    rawData.forEach(timestamp => {
        const date = new Date(timestamp * 1000);
        const day = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}-${String(date.getDate()).padStart(2, '0')}`;
        const month = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}`;

        groupedByDay[day] = (groupedByDay[day] || 0) + 1;
        groupedByMonth[month] = (groupedByMonth[month] || 0) + 1;
    });

    const uniqueMonths = Object.keys(groupedByMonth).length;

    if (uniqueMonths === 1) {
        return {
            labels: Object.keys(groupedByDay),
            datasets: [
                {
                    label: 'Feedback in days',
                    data: Object.values(groupedByDay),
                    borderColor: '#45a01e',
                    backgroundColor: 'rgba(169,214,148,0.5)',
                    pointBorderColor: '#68c241',
                    pointBackgroundColor: '#45a01e',
                    pointHoverBackgroundColor: '#68c241',
                    pointHoverBorderColor: '#ffffff',
                    pointStyle: 'circle',
                    pointRadius: 10,
                    pointHoverRadius: 15
                }
            ]
        };
    } else {
        return {
            labels: Object.keys(groupedByMonth),
            datasets: [
                {
                    label: 'Feedback in days',
                    data: Object.values(groupedByMonth),
                    borderColor: '#45a01e',
                    backgroundColor: 'rgba(169,214,148,0.5)',
                    pointBorderColor: '#68c241',
                    pointBackgroundColor: '#45a01e',
                    pointHoverBackgroundColor: '#68c241',
                    pointHoverBorderColor: '#ffffff',
                    pointStyle: 'circle',
                    pointRadius: 10,
                    pointHoverRadius: 15
                }
            ]
        };
    }
}

Chart.defaults.plugins.tooltip.callbacks.label = function (context) {
    var label = context.dataset.label || '';
    if (label) {
        label += ': ';
    }
    if (context.parsed.y !== null) {
        label += new Intl.NumberFormat('en-US').format(context.parsed.y);
    }
    return label;
};

if (document.getElementById('chart-filters') && document.getElementById('analysis')) {

    let data = processData(rawData);

    function updateChart(filter) {
        if (filter === 'all') {
            data = processData(rawData);
        } else {
            const filteredData = rawData.filter(timestamp => {
                const date = new Date(timestamp * 1000);
                const month = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}`;
                return month === filter;
            });
            data = processData(filteredData);
        }
        chart.data = data;
        chart.update();
    }

    const uniqueMonths = [...new Set(rawData.map(timestamp => {
        const date = new Date(timestamp * 1000);
        return `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}`;
    }))];


    const filtersDiv = document.getElementById('chart-filters');
    uniqueMonths.forEach(month => {
        const button = document.createElement('button');
        button.innerText = month;
        button.classList.add('shadow')
        button.onclick = () => {
            updateChart(month);
        document.querySelectorAll('#chart-filters button').forEach(btn => {
            btn.classList.remove('active-button');
        });

        button.classList.add('active-button');
        }
        filtersDiv.appendChild(button);
    });

    const ctx = document.getElementById('analysis').getContext('2d');
    let chart = new Chart(ctx, {
        type: 'line',
        data: data,
        options: {
            responsive: true,
            maintainAspectRatio: false,
            scales: {
                x: {
                    type: 'time',
                    time: {
                        unit: 'day',
                        displayFormats: {
                            day: 'yyyy-MM-dd'
                        }
                    },
                    title: {
                        display: true,
                        text: 'Date'
                    }
                },
                y: {
                    title: {
                        display: true,
                        text: 'Actions'
                    }
                }
            }
        }
    });
}
$(document).ready(() => {
    function checkWindowSize() {
        if ($(window).width() < 700) {
            $('.wrapper').removeClass('pined');
            if (document.querySelector(".alert_promo")) {
                $('.wrapper').removeClass('alert');
            }

            $('.wrapped_menu').css('left', "-100%");

            $('.wrapped_menu').css('transition', "0s ease");
            $('.wrapped_menu').css('left', "-100%");
            $('.main').removeClass('menu-m');
        } else {
            $('.wrapped_menu').css('transition', "0s ease");
            $('.wrapper').addClass('pined');

            if (document.querySelector(".alert_promo")) {
                $('.wrapper').addClass('alert');
            }
            $('.wrapped_menu').css('left', "0");
            $('.main').removeClass('menu-m');
            $('.wrapped_menu').css('display', "flex");
        }
    }

    checkWindowSize()
    if ($(window).width() < 700) {
        $('.wrapped_menu').css('display', "flex");
    } else {
        $('.wrapped_menu').css('display', "flex");
    }
    $(window).on('resize', checkWindowSize);
});

function openMenuWrap() {
    $('.wrapped_menu').css('transition', "0.4s ease");
    $('.wrapped_menu').css('left', "0%");
    $('.main').addClass('menu-m');
}

function closeMenuWrap() {
    $('.wrapped_menu').css('transition', "0.4s ease");
    $('.wrapped_menu').css('left', "-100%");
    $('.main').removeClass('menu-m');
}

