if (document.querySelector(".file-upload")) {
    $(".file-upload").on('change', function () {
        readURL(this);
    });
    $(".btn-file-ava").on('click', function () {
        $(".file-upload").click();
    });
    $(".upload-button").on('click', function () {
        $(".file-upload").click();
    });
    $(".btn-file-ava").on('click', function () {
        $(".file-upload").click();
    });

    function readURL(input) {
        if (input.files && input.files[0]) {
            var reader = new FileReader();
            reader.onload = function (e) {
                var fileurl = e.target.result;
                $('.profile-pic').attr('src', fileurl);
                var formData = new FormData();
                formData.append('logo', input.files[0]);
                $.ajax({
                    url: '/api/update_avatar',
                    method: 'POST',
                    data: formData,
                    contentType: false,
                    processData: false,
                    success: function (response) {
                        $('.company_data .company img').attr('src', response.src)
                        $('.user_controll .company_avatar img').attr('src', response.src)

                        $('.btn-file-ava').css('background', '#18e638')
                        $('.btn-file-ava .alr').addClass('hidden')
                        $('.btn-file-ava .done ').removeClass('hidden')
                        setTimeout(() => {
                            $('.btn-file-ava').css('background', '#7793ff')
                            $('.btn-file-ava .alr').removeClass('hidden')
                            $('.btn-file-ava .done ').addClass('hidden')
                        }, 2000)
                    }
                });
            };
            reader.readAsDataURL(input.files[0]);
        }
    }
}


