    function createInputQuestion(targetNumber) {
        if (targetNumber != 0) {
            $('.no_found_answer').addClass('hidden')
            $('.container_answers').removeClass('hidden')

            const container = document.querySelector('.answers_creator');
            const existingAnswers = container.querySelectorAll('.answer');
            const existingCount = existingAnswers.length;

            if (existingCount < targetNumber) {
                for (let i = existingCount; i < targetNumber; i++) {
                    container.appendChild(createAnswerField());
                }
            } else {
                for (let i = existingCount; i > targetNumber; i--) {
                    container.removeChild(existingAnswers[i - 1]);
                }
            }

            $('.answers_creator .answer button').click((e) => {
                let target = $(e.target);
                let el = target.closest('.answer')
                el.find('input').val("")
            })
        } else {
            $('.no_found_answer').removeClass('hidden')
            $('.container_answers').addClass('hidden')
        }
    }

