    function addQuestionQuiz() {
        let el_count = $('.questions_container .questions_quiz').children()
        if (el_count.length == 0) {
            $('.questions_container').addClass('hidden')
        } else {
            $('.questions_container').removeClass('hidden')
        }

        let valid = 0;
        let text = `<ul>`;
        let title = $('.column_box.creator .main_title').val();
        if (title == "") {
            valid++;
            text += `<li>You forgot to enter the name of the survey</li>`
            $('.column_box.creator .main_title').addClass('invalid')
        } else {
            $('.column_box.creator .main_title').removeClass('invalid')
        }
        let timer = false;
        if ($('.column_box.creator .timer_select').hasClass('active')) {
            timer = $('.column_box.creator .timer_select input').val()
            timer = timer.replace(/\D/g, '');
            var numberValue = parseInt(timer);
            if (!isNaN(numberValue)) {
                if (numberValue < 2) {
                    numberValue = 2;
                }
                timer = Number(numberValue)
            } else {
                timer = 2
            }
        }
        let answers_array = [];
        let count_invalid = 0;
        let answers = $('.answers_creator').children();
        if (answers.length > 0) {
            answers.map((idx, item) => {
                let value = $(item).find('input').val()
                if (value == "") {
                    $(item).find('input').addClass('invalid');
                    count_invalid++;
                } else {
                    $(item).find('input').removeClass('invalid');
                    answers_array.push(value)
                }
            })

        } else {
            valid++;
            text += `<li>You haven't added a single answer to the question</li>`
        }

        if (answers_array.length == 0) {
            valid++;
            text += `<li>There is not a single field to answer the question</li>`
        }

        if (count_invalid != 0) {
            if (count_invalid > 1) {
                text += `<li>You have several reply fields blank</li>`
            } else {
                text += `<li>You have one reply field blank</li>`
            }
        }

        if (valid != 0) {
            $('.alert_err_answer').html(text + "</ul>")
            $('.alert_err_answer').removeClass('hidden')
        } else {
            $('.alert_err_answer').addClass('hidden')
            let obj = {
                "title": title,
                "timer": timer,
                "count_buttons": Number(answers.length),
                "answers_array": answers_array
            }
            let buttons = ``
            answers_array.map((item) => {
                buttons += `<el>${item}</el>`
            })

            if (timer == false) {
                timer = "Not set"
            } else {
                timer = timer + "sec."
            }

            let answer_html = `
            <div class="q_text">
                <div class="info_answer">
                    <div class="row d-flex jc-b">
                        <h4>${title}</h4>
                        <div class="timer">
                            <svg viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><title/><g data-name="Layer 2" id="Layer_2"><path d="M4,14a8,8,0,1,0,8-8A8,8,0,0,0,4,14Zm8-6a6,6,0,1,1-6,6A6,6,0,0,1,12,8Z"/><rect height="2" width="4" x="10" y="2"/><rect height="2" transform="translate(-2.78 5.29) rotate(-45)" width="4.24" x="2.88" y="5"/><rect height="5" width="2" x="11" y="10"/></g></svg>
                            <p>${timer}</p>
                        </div>
                    </div>
                    <div class="grid">
                        ${buttons}
                    </div>
                </div>
                <div class="col">
                    <button>
                        <svg baseProfile="tiny" version="1.2" viewBox="0 0 24 24" xml:space="preserve" xmlns="http://www.w3.org/2000/svg"><path d="M12 3c-4.963 0-9 4.038-9 9s4.037 9 9 9 9-4.038 9-9-4.037-9-9-9zm0 16c-3.859 0-7-3.14-7-7s3.141-7 7-7 7 3.14 7 7-3.141 7-7 7z" fill="#ff3d3d" class="fill-000000"></path><path d="m12.707 12 2.646-2.646a.502.502 0 0 0 0-.707.502.502 0 0 0-.707 0L12 11.293 9.354 8.646a.5.5 0 0 0-.707.707L11.293 12l-2.646 2.646a.5.5 0 0 0 .707.708L12 12.707l2.646 2.646a.5.5 0 1 0 .708-.706L12.707 12z" fill="#ff3d3d" class="fill-000000"></path></svg>
                    </button>
                </div>
            </div>
            `;
            $('.questions_container .questions_quiz').append(answer_html)
            $('.status_quiz count').text($('.questions_container .questions_quiz').children().length)

            // Clear data
            $('.column_box.creator .main_title').val("")

            if ($('.questions_container .questions_quiz').children().length == 0) {
                $('.questions_container').addClass('hidden')
            } else {
                $('.questions_container').removeClass('hidden')
            }
            firstQuestionChecker()

            $('.q_text button').click((e) => {
                $(e.target).closest('.q_text').remove()
                let el_count = $('.questions_container .questions_quiz').children()
                $('.status_quiz count').text($('.questions_container .questions_quiz').children().length)
                firstQuestionChecker()
                if (el_count.length == 0) {
                    $('.questions_container').addClass('hidden')
                } else {
                    $('.questions_container').removeClass('hidden')
                }
            })
            draged()
        }
    }

