    function validation_save_quiz() {
        let text = `<ul>`
        let valid = 0;
        let input = $('.quiz_link .name_link input').val()
        if (input == "") {
            text += ""
            valid++;
            $('.quiz_link .name_link input').addClass('invalid')
        } else {
            $('.quiz_link .name_link input').removeClass('invalid')
        }

        let questions_quiz_array = [];
        let questions_quiz = $('.column_box.questions_container .questions_quiz').children()
        if (questions_quiz.length != 0) {
            questions_quiz.each((idx, item) => {
                let title = $(item).find('.info_answer h4').text()
                let timerText = $(item).find('.timer p').text();
                let timer = false;
                let matches = timerText.match(/(\d+)sec\./);
                if (matches && matches[1]) {
                    timer = Number(matches[1]);
                }
                let buttons = [];
                $(item).find('.grid').children().each((index, btn) => {
                    buttons.push($(btn).text());
                });

                questions_quiz_array.push({
                    "timer": timer,
                    "question": title,
                    "buttons": buttons
                })
            })
            if (questions_quiz_array.length == 0) {
                valid++;
            }
            let title_quiz = $('.quiz_link .name_link input').val();
            if (title_quiz == "") {
                valid++;
            }
            let img_quiz = $('.ava-pic').attr('src');
            if (img_quiz == "") {
                valid++;
            }
            let theme_color = pickr.getColor().toHEXA().toString();
            if (!theme_color) {
                valid++;
            }

            let checkboxStatus = ""
            if ($('#checkbox_name').is(':checked')) {
                checkboxStatus = "name"
            }
            if ($('#checkbox_email').is(':checked')) {
                checkboxStatus = "email"
            }
            if ($('#checkbox_phone').is(':checked')) {
                checkboxStatus = "phone"
            }
            let checkboxBadgeStatus = $('#checkbox_badge').is(':checked');
            let obj = {
                "title": title_quiz,
                "image": img_quiz,
                "theme_color": theme_color,
                "questions": questions_quiz_array,
                "request": checkboxStatus,
                "company_badge": checkboxBadgeStatus,
            }

            if (valid == 0) {

                if ($('#save_quiz').attr('d-e') == "False") {
                    $.ajax({
                        url: '/api/quiz/create_link',
                        method: 'POST',
                        data: JSON.stringify(obj),
                        contentType: "application/json",
                        success: function (response) {
                            if (response.success == true) {
                                $.toast({
                                    text: response.message,
                                    position: 'top-right',
                                    hideAfter: 3000,
                                    showHideTransition: 'fade',
                                    icon: 'success',
                                    stack: false
                                })
                                location.href = '/dashboard/services/quiz'
                            } else {
                                $.toast({
                                    text: response.message,
                                    position: 'top-right',
                                    hideAfter: 3000,
                                    showHideTransition: 'fade',
                                    icon: 'error',
                                    stack: false
                                })
                            }
                        }
                    });
                } else {
                    obj['token'] = $('#save_quiz').attr('token')
                    $.ajax({
                        url: '/api/quiz/edit',
                        method: 'POST',
                        data: JSON.stringify(obj),
                        contentType: "application/json",
                        success: function (response) {
                            if (response.success == true) {
                                $.toast({
                                    text: response.message,
                                    position: 'top-right',
                                    hideAfter: 3000,
                                    showHideTransition: 'fade',
                                    icon: 'success',
                                    stack: false
                                })
                                location.href = '/dashboard/services/quiz'
                            } else {
                                $.toast({
                                    text: response.message,
                                    position: 'top-right',
                                    hideAfter: 3000,
                                    showHideTransition: 'fade',
                                    icon: 'error',
                                    stack: false
                                })
                            }
                        }
                    });
                }
            }
        }
    }

